import Image from "../images/myAvatar.png";
import { Avatar } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles(theme => ({
  root: {
    display: "flex",
    "& > *": {
      margin: theme.spacing(1)
    },
    large: {
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      width: theme.spacing(7),
      height: theme.spacing(7)
    }
  }
}));
export default function ThirdPage() {
  const classes = useStyles();
  return (
    <Container fixed>
      <Typography variant="h1">Hello!</Typography>
      <Typography variant="h2">Welcome to my Portfolio</Typography>
      <div className={classes.root} className={classes.large}>
        <Avatar src={Image} />
      </div>
      <Typography variant="h3">My Name Is Axel Lor√©n</Typography>
      <Typography variant="h4">And I'm A Front End Developer</Typography>
    </Container>
  );
}
